import React from 'react';
import { Dialog, DialogTitle } from '@material-ui/core';

const Modal = props => {

	return (
		<Dialog onClose={() => props.setDialog(false)} open={props.dialog}>
	      <DialogTitle>Set backup account</DialogTitle>
	      
	    </Dialog>
	);
}

export default Modal;
